import { CssBaseline, ThemeProvider, createTheme } from "@mui/material";
import ProtectedLayout from "layout/ProtectedLayout";
import Home from "pages/Home";
import Login from "pages/Login";
import Profile from "pages/Profile";
import Root from "pages/Root";
import { useMemo } from "react";
import { useSelector } from "react-redux";
import { createBrowserRouter, createRoutesFromElements, Route, RouterProvider } from "react-router-dom";
import { themeSetting } from "theme";

function App() {
  const mode = useSelector((state) => state.mode);
  const theme = useMemo(() => createTheme(themeSetting(mode)), [mode]);


  const router = createBrowserRouter(
    createRoutesFromElements(
      <>

          <Route path="/" element={<ProtectedLayout><Root /></ProtectedLayout>} >
            <Route index={true} element={<ProtectedLayout><Home /></ProtectedLayout>} > </Route>
            <Route path="/home" element={<ProtectedLayout><Home /></ProtectedLayout>} ></Route>
            <Route path="/profile" element={<ProtectedLayout><Profile /></ProtectedLayout>} ></Route>
          </Route>


        <Route path="/login" element={<ProtectedLayout ><Login /></ProtectedLayout > } ></Route>
      </>
    )
  )
  return (
    <div className="App">
      <ThemeProvider theme={theme}>
        <CssBaseline />
        <RouterProvider router={router} />
      </ThemeProvider>
    </div>
  );
}

export default App;
